import React,{Component} from 'react';
import { Icon } from 'semantic-ui-react'
class Landingcontent extends React.Component{
	constructor(props){
		super(props)

	}
	render(){
		return(
			<div>
			<div className="main1">
				<div className="c1">
					<div className="c1main">
						<div className="m1">
						<p><b>112</b></p>
						<p> Matches for exposed Information</p>
						<hr/>
						</div>
						<div className="m2">
						<p><b>63</b></p>
						<p> Passwords found</p>
						</div>
						<div className="m3">
						<p><b>29</b></p>
						<p> Personal Information</p>
						</div>
						<div className="m4">
						<p><b>20</b></p>
						<p>Hacker Group Targeting</p>
						</div>
						<div className="m5">
						<a>
						<pre> View Exposed Information <Icon flipped='horizontally' fitted name='caret left' size="large" />
						</pre>
						</a>
						</div>
					</div>
				</div>
				<div className="c2">
				</div>

				<div className="c3">

				</div>


			</div>

						<div  className="footer">
			<p> Copyright 2020 © Cyber Intelligence House</p>
			</div>
			<style jsx>{`
				.c1main{
					margin-left:15px;
					margin-top:30px;
					width:90%;
				}
				.m1{


				}
				.m1 >p{
					line-height: 10px;
				}
				.m2{
					margin-top:15px;
				}
				.m2 >p{
					line-height: 10px;
				}
				.m3{
					margin-top:20px;
				}
				.m3 >p{
					line-height: 10px;
				}
				.m4{
					margin-top:20px;
				}
				.m4 >p{
					line-height: 10px;
				}
				.m5{
					display:flex;
					align-items:flex-end;
					justify-content:flex-end;
					margin-top:30px;


				}
					.footer{
					  position: fixed;
					  left: 0;
					  bottom: 0;
					  width: 100%;
					  
					  color: gray;
					  text-align: center;
				}
				}
			}
				.main1{

					display:flex;
					flex-direction:row;
					height:500px;
					margin-top:80px;
					align-items:center;
					justify-content:center;
					flex-wrap: wrap;
					


				}
				.c1{
					display:flex;
					margin-top:60px;
					background:white;
					height:350px;
					width:350px;
					 border: 0.5px solid #dddfe6;;
					 box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
					
				}
				.c2{
					display:flex;
					width:350px;
					margin-left:20px;
					background:white;
					height:350px;
					 margin-top:60px;
					 border: 0.5px solid #dddfe6;;
					 box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
					
				}
				.c3{
					display:flex;
					width:350px;
					background:white;
					height:350px;
					 margin-top:60px;
					 border: 0.5px solid #dddfe6;;
					 box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
				}
				 @media (max-width: 1044px) {
				    .footer {
				          position: relative;
						  left: 0;
						  bottom: -200;
						  width: 100%;
						  text-align: center;
				        
				    }
				    .main1{
				    display:flex;
					flex-direction:row;
					height:1500px;
					margin-top:80px;
					align-items:center;
					justify-content:space-around;
					flex-wrap: wrap;
					
				    }

}
				`}</style>

			</div>

		)
	}
}
export default Landingcontent
